      "content": "\u003cdiv class\u003d\"introduction img-head\"\u003e\r\n  \u003cdiv class\u003d\"header\"\u003e\r\n        \u003cimg src\u003d\"data:image/png;base64,\u003d\" \r\n        alt\u003d\"App Icon\"\u003e\r\n    \u003ch3\u003eEquipment Predictive Maintenance Business User App\u003c/h3\u003e\r\n  \u003c/div\u003e\r\n\r\n  \u003csection\u003e\r\n    \u003ch4\u003eOverview\u003c/h4\u003e\r\n    \u003cp\u003eThis app helps businesses stay ahead of equipment failures by providing a clear view of which machines may need maintenance soon. By uploading your maintenance data, you can quickly visualize risk trends and take timely action to reduce downtime.\u003c/p\u003e\r\n  \u003c/section\u003e\r\n\r\n\u003csection\u003e\r\n    \u003ch4\u003eInput\u003c/h4\u003e\r\n    \u003cul\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003eUpload company-specific maintenance dataset (CSV format).\u003c/li\u003e\r\n       \u003c/ul\u003e\r\n  \u003c/section\u003e\r\n\r\n\u003csection\u003e\r\n    \u003ch4\u003eOutput\u003c/h4\u003e\r\n    \u003cul\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003ePredictive maintenance graph showing likelihood of upcoming failures.\u003c/li\u003e\r\n\u003cli\u003e\u003cspan\u003e+\u003c/span\u003eRaw prediction data for each equipment unit, aiding further analysis.\u003c/li\u003e\r\n\u003cli\u003e\u003cspan\u003e+\u003c/span\u003eRoot Cause Analysis (RCA): Detects recurring failure patterns and explains potential causes.\u003c/li\u003e\r\n       \u003c/ul\u003e\r\n  \u003c/section\u003e\r\n\r\n  \u003csection\u003e\r\n    \u003ch4\u003eBenefits\u003c/h4\u003e\r\n    \u003cul\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003eUpload equipment maintenance data to generate predictive insights.\u003c/li\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003eView intuitive maintenance predictions using pre-trained H2O models.\u003c/li\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003eQuickly identify assets at risk of failure to support proactive decisions.\u003c/li\u003e\r\n      \u003c/ul\u003e\r\n  \u003c/section\u003e\r\n\u003c/div\u003e\r\n",
